        <h2>Protect your Profits with a Rescue Treatment</h2>
        <p>The U.S. agriculture industry loses upwards of $2.5 billion a year as a result of stored grains lost to insect infestations. Don&rsquo;t let these bugs eat away at profits. When live insects are infesting stored grains, turn the grain and apply a rescue treatment.</p>
        <p>For grains that are being stored 6 months or longer, treat the grain with a tank mix of <a href="~/link.aspx?_id=AF0021634852455C802076CEBE7F7F7C&amp;_z=z">Diacon<sup>&reg;</sup> IGR <em>PLUS</em></a>&nbsp;and <a href="~/link.aspx?_id=E187C7445D1E46A1B80DDF73A434E91B&amp;_z=z">PBO-8<sup>&reg;</sup> Synergist</a>. For grains being stored 3 months or less, use a tank mix of <a href="~/link.aspx?_id=C75C15245B4E46A191A87B6F252EB1CD&amp;_z=z">Centynal<sup>&trade;</sup> EC Insecticide</a>&nbsp;and <a href="~/link.aspx?_id=E187C7445D1E46A1B80DDF73A434E91B&amp;_z=z">PBO-8<sup>&reg;</sup> Synergist</a>. For additional control, spray <a href="~/link.aspx?_id=C75C15245B4E46A191A87B6F252EB1CD&amp;_z=z">Centynal<sup>&trade;</sup> EC Insecticide</a>&nbsp;to the outside perimeter of the bin to control invaders.</p>
        <div class="sxa-btn indent-bottom-sm">
        <a href="-/media/1B1D8AAA98FA447A90125F86A095AC32.ashx" target="_blank">Learn more about treatment options in our Bug Free Grains catalog</a>
